    end
    
    procesar_resultados("Fase3/ficherosGUI/negativo/" + fichero, 0.035, 20, 3) %[output:87180773] %[output:312a4a26] %[output:293d5da1] %[output:4aa789e9] %[output:5a051fb3] %[output:89106641] %[output:8a43bd16] %[output:718c2bf8] %[output:625dd17b] %[output:84ab8ae3] %[output:385be97c] %[output:5716eada] %[output:045a6e4a] %[output:92b05745] %[output:4939751b] %[output:53628e04] %[output:744f229c] %[output:0afddcae]
